const zPattern = () => {
  return (
    <Fragment>
        <div className='zPatternwrap d-flex'>
            <div className='zPatternLeft'>dsdsd</div>
            <div className='zPatternright'></div>
        </div>
    </Fragment>
  )
}

export default zPattern
